body = {
    "operationName": "menu",
    "variables": {
        # "storeId": "360",
        # "storeId": "2693"
        "storeId": ''
        # "menuId": "223199"
    },
    "query":'''
          query menu($storeId: ID!, $menuId: ID) {
            storeInformation(storeId: $storeId) {
              id
              name
              description
              isGoodForGroupOrders
              offersPickup
              offersDelivery
              deliveryFee
              sosDeliveryFee
              numRatings
              averageRating
              shouldShowStoreLogo
              isConsumerSubscriptionEligible
              headerImgUrl
              coverImgUrl
              distanceFromConsumer
              providesExternalCourierTracking
              fulfillsOwnDeliveries
              isDeliverableToConsumerAddress
              priceRange
              business {
                id
                name
                __typename
              }
              address {
                street
                printableAddress
                lat
                lng
                city
                state
                __typename
              }
              status {
                asapAvailable
                scheduledAvailable
                asapMinutesRange
                asapPickupMinutesRange
                __typename
              }
              merchantPromotions {
                id
                minimumOrderCartSubtotal
                newStoreCustomersOnly
                deliveryFee
                __typename
              }
              storeDisclaimers {
                id
                disclaimerDetailsLink
                disclaimerLinkSubstring
                disclaimerText
                displayTreatment
                __typename
              }
              __typename
            }
            storeMenus(storeId: $storeId, menuId: $menuId) {
              allMenus {
                id
                name
                subtitle
                isBusinessEnabled
                timesOpen
                __typename
              }
              currentMenu {
                id
                timesOpen
                hoursToOrderInAdvance
                isCatering
                minOrderSize
                menuCategories {
                  ...StoreMenuCategoryFragment
                  items {
                    ...StoreMenuListItemFragment
                    __typename
                  }
                  __typename
                }
                __typename
              }
              __typename
            }
            storeCrossLinks(storeId: $storeId) {
              trendingStores {
                ...StoreCrossLinkItemFragment
                __typename
              }
              trendingCategories {
                ...StoreCrossLinkItemFragment
                __typename
              }
              topCuisinesNearMe {
                ...StoreCrossLinkItemFragment
                __typename
              }
              nearbyCities {
                ...StoreCrossLinkItemFragment
                __typename
              }
              __typename
            }
            storeMenuSeo(storeId: $storeId, menuId: $menuId)

          }

        fragment StoreMenuCategoryFragment on StoreMenuCategory {
          id
          subtitle
          title
          __typename
        }

        fragment StoreMenuListItemFragment on StoreMenuListItem {
          id
          description
          isTempDeactivated
          price
          imageUrl
          name
          __typename
        }

        fragment StoreCrossLinkItemFragment on StoreCrossLinkItem {
          name
          url
          __typename
        }

    '''
}
